pragma solidity ^0.5.0;

contract Client {
    string firstname;
    string lastname;
    bool exists;
    uint startDate;
    uint noDays;
    address owner;

    constructor(string memory _firstname,string memory _lastname,uint _noDays,address _owner,bool _exists) public{
        firstname = _firstname;
        lastname = _lastname;
        exists = _exists;
        noDays = _noDays;
        owner = _owner;
        startDate = now;

    }
    function checkExists() public returns(bool){
        return exists;
    }
    function getAddress() public returns(address){
        return owner;
    }
}
